De bodyguard van een diplomaat raakt samen met nog een paar andere mensen gewond tijdens een moordaanslag. Ze worden allemaal naar hetzelfde ziekenhuis gebracht. De bodyguard besluit samen met een zuster de diplomaat te beschermen tegen een groep genadeloze huurmoordenaars.

